import React, { Component } from "react";
import SearchIcon from "./white-search-icon.jpg";
//import "./NavBar.css";

class Navbar extends Component {
  state = { options: [] };

  generateId() {
    return Math.random()
      .toString(36)
      .substr(2, 9);
  }

  render() {
    return (
      <nav className={this.props.navCls}>
        <ul>
          {this.props.options.map(option => {
            return (
              <li className={this.props.navOptionCls} key={this.generateId()}>
                {option.title}
                <div className={this.props.navDotCls}></div>
              </li>
            );
          })}
        </ul>
      </nav>
    );
  }
}

export default Navbar;
